	@Test
	public void testSignVerify() throws Exception
	{
		final Random random = TestUtils.getDeterministicRandom();

		final WOTSpConfig config = getSHA256WOTSpConfig();
		final byte[] privateKey = new byte[config.getKeyLength()];
		final byte[] publicSeed = new byte[config.getN()];
		final byte[] publicKey = new byte[config.getKeyLength()];
		final byte[] signature = new byte[config.getKeyLength()];
		final byte[] signature2 = new byte[config.getKeyLength()];
		final byte[] msg = new byte[32];

		for(int i = 0; i < 1_000; i++)
		{
			random.nextBytes(privateKey);
			random.nextBytes(publicSeed);
			random.nextBytes(msg);

			WOTSp.generate(config, privateKey, publicSeed, publicKey, 0);
			WOTSp.sign(config, msg, privateKey, publicKey, publicSeed, signature, 0);

			if(i % 100 == 0)
			{
				/* Make sure that any change on the signature fail the validation */
				for(int j = 0; j < signature.length; j++)
				{
					System.arraycopy(signature, 0, signature2, 0, signature.length);
					if((signature2[j] & 1) == 0)
						signature2[j]++;
					else
						signature2[j]--;
					Assert.assertFalse(WOTSp.verify(config, msg, signature2, publicKey, publicSeed));
				}
			}
			else
				Assert.assertTrue(WOTSp.verify(config, msg, signature, publicKey, publicSeed));
		}
	}

	public static WOTSpConfig getSHA256WOTSpConfig()
	{
		final HashFunction sha256 = new HashFunction()
		{
			@Override
			public int digestLength()
			{
				return 32;
			}

			@Override
			public Instance newInstance()
			{
				final MessageDigest nativeSHA256;
				try
				{
					nativeSHA256 = MessageDigest.getInstance("SHA-256");
				} catch(final NoSuchAlgorithmException e)
				{
					throw new RuntimeException(e);
				}

				return new Instance()
				{

					@Override
					public Instance update(final byte[] data) throws HashFunctionException
					{
						nativeSHA256.update(data);
						return this;
					}

					@Override
					public Instance update(final byte[] data, final int offset, final int length) throws HashFunctionException
					{
						nativeSHA256.update(data, offset, length);
						return this;
					}

					@Override
					public byte[] digest(final byte[] destination) throws HashFunctionException
					{
						final byte [] digest = nativeSHA256.digest();
						System.arraycopy(digest, 0, destination, 0, digest.length);
						return digest;
					}
				};
			}
		};

		return WOTSpConfig.get32bytesCompactSignatureConfig(sha256);
	}

